import React from 'react';

const SignupHeader = styled.div`
    width: 600px;
    height: 100px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 36px;
    font-weight: bold;
`;

const SignupSection = styled.div`
    background-color: #ccf;
    height: 100vh;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`;

const SignupMain = () => {
    return (
        <SignupSection>
            <SignupHeader></SignupHeader>
        </SignupSection>
    );
};

export default SignupMain;
